function Machineparkpump({allPumps, pump}) {

    return (
        <div>
            <form className ="forms" id="editpump" onSubmit={function(event){
                event.preventDefault();
                updatePump();
            }}>
                <label>Pumpe navn </label>
                <input type="text" id="editpumpname" name="editpumpname" required>{pump.name}</input><br></br>
                <label>Pumpe nummer </label>
                <input type="text" id="editpumpnumber" name="editpumpnumber" required>{pump.number}</input><br></br>
                <label>Pumpe startcode </label>
                <input type="text" id="editpumpstartcode" name="editpumpstartcode" required>{pump.startcode}</input><br></br>
                <label>Pumpe stopcode </label>
                <input type="text" id="editpumpstopcode" name="editpumpstopcode" required>{pump.stopcode}</input><br></br>
                <button className="createandupdatebuttons" type="submit">OPDATER</button>
            </form>
          </div>
    )
}
export default Machineparkpump
